query:
/*+ NoMergeJoin(ci t) NoNestLoop(ci t mk) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id > 3642804 AND ci.role_id = 10 AND t.kind_id < 7 AND t.production_year > 1946
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id > 2837;
